import React from 'react';

const Attacks = ({ pokemon }) => (

    <div>
        {pokemon.attacks.map(attack => {
            return <div
                key={attack.name}
            >
                <h2>Attack: {attack.name}</h2>
                <h3>{attack.text}</h3>
                <h3>Cost: {attack.cost}</h3>
            </div>
        })}
    </div>
);

export default Attacks;
